import React from 'react';
import Layout from './Layout';

function Cart() {
  return (
    <Layout>
      <h1>Cart</h1>
      <div className="cart-container">
        <div>Items</div>
        <div>Total</div>
      </div>
    </Layout>
  )
}

export default Cart;
